import React from 'react';
import Header from './Comp/Header.js';
import Body from './Comp/Body.js';
import Footer from './Comp/Footer.js';

class Layout extends React.Component{

  render(){
    return(
      <div>
        <div className="navbar-brand">
            <a className="navbar-item" href="https://www.google.com/">
            <img src="https://media.istockphoto.com/vectors/vector-logo-letter-s-glitch-distortion-vector-id1008253602?k=6&m=1008253602&s=170667a&w=0&h=GvoJK4nAkR7vsDdrpGjaYSGHyPkOlxLUssgUvwTbxxA="
            alt="Spencer Logo" />
            </a>

            <a role="button" className="navbar-burger" aria-label="menu" aria-expanded="false">
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
            </a>
        </div>

        <div className="navbar-menu">
            <div className="navbar-start">
            Start
            </div>

            <div className="navbar-end">
            End
            </div>
        </div>

        <Header />
        <Body/>
        <Footer/>
    </div>
    );
  }
} 


export default Layout;
